import { Route, Router } from 'react-router-dom';
import EmployeeList from './Pages/EmployeeList';
import Home from './Pages/Home';



function App() {
  return (
    <div className="App">

   <Router>
    <Route path='/' exact component={Home}/>
    <Route path='/employee' component={EmployeeList}/>
   </Router>
    </div>
  );
}

export default App;
